import React from 'react'
import NewGameButton from './NewGameButton'

class Header extends React.Component {
    render(){
        return (
            <div className="col-md-6 offset-3 main-app">
                <h1>Lutrivia</h1>
                <section>
                    <NewGameButton />
                </section>
            </div>
        );
    }
}

export default Header
